import { Container, Card } from "react-bootstrap";

const DogCarousel = () => {
  return (
<Container fluid className="py-2 bg-secondary" style={{ overflowX: "hidden" }}>
      <h2 className="font-weight-light">Bootstrap 4 Horizontal Scrolling Cards with Flexbox</h2>
      <div className="d-flex flex-row flex-nowrap overflow-auto" style={{ overflow: "auto" }}>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 1</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 2</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 3</div>
