        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 11</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 12</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 13</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0" style={{ width: "18rem" }}>Card 14</div>
      </div>
    </Container>
  );
};

export default DogCarousel;
